import React from "react";
import {Helmet} from "react-helmet";
import Typekit from 'react-typekit';

class MarineTrafficMap extends React.Component {
  render () {
    return (
        <div className="application">
            <Helmet>
                <meta charSet="utf-8" />
                <title>My Title</title>
                <link rel="canonical" href="http://www.marinetraffic.com/js/embed.js" />
                <script type="text/javascript" src="http://www.marinetraffic.com/js/embed.js"></script>
            </Helmet>
            ...
        </div>
    );
  }
};

export default MarineTrafficMap;
